import React, { Component } from "react";
import ReactLiveSearch from 'react-live-search'

class EventSelect extends Component {

  state = {
    eventTitle: '',
    value: '',
    data: [
      {
        label: 'la county fair',
        value: 1
      },
      {
        label: 'off the grid',
        value: 2
      },
      {
        label: 'uc riverside',
        value: 3
      },
      {
        label: 'knotts berry farm',
        value: 4
      },
      {
        label: 'eat drink vegan',
        value: 5
      },
    ]
  };

  onChange = value => {
    this.setState({
      value
    });
  };

  onSelect = eventTitle => {
    this.setState({
      eventTitle
    })
  };


  render() {
    return (
      <ReactLiveSearch
        value={this.state.value}
        onChange={this.onChange}
        onSelect={this.onSelect}
        data={this.state.data}
      />
    )
  }
}
export default EventSelect;
